import Food from "./Food"
const Order = ({order}) =>{

    var showFoods = true
    const onClick = () =>{
        console.log(showFoods)
        console.log(order.foods)
        showFoods = !showFoods
    }  
    return(
        <div>
            <div className = "speciality" onClick={() => onClick()}>
                <h3>
                    {order.restaurant}
                </h3>
                <h3>
                    {order.price + " RON"}
                </h3>
                <h3 >
                    {order.date + " at " + order.time}
                </h3>
                <h3 className="status">
                    {order.status}
                </h3>
            </div>
            {showFoods && <div className = "container-2">
                            {order.foods.map((food, index) => (
                                <Food key = {index} food = {food} />
                            ))}
                        </div>} 
        </div>
       
    )
}

export default Order
